import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on Electronics category card
    await page.waitForSelector('.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('.category-card:has-text("Electronics")');

    // Wait for category page to load and take screenshot
    await page.waitForSelector('h2:has-text("Electronics")', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Extract category information
    const categoryTitle = await page.textContent('h2');
    const productCount = await page.$$eval('.product-card', cards => cards.length);

    return {
      success: true,
      action: "Navigated to Electronics category successfully",
      extractedData: {
        category: categoryTitle,
        productCount: productCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
